import React from "react";
import produtos from "../../data/produtos";

export default function TabelaProdutos(props){
    const produtosul = produtos.map((produto) => {
        return (
            <ul key={produto.id} style={{ listStyle: 'none'}}>
                <li>Codigo: {produto.id}</li>
                <li>{produto.nome} --- R${produto.preco}</li>
            </ul>
        );
    });

    return(
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Codigo</th>
                        <th>Produto</th>
                        <th>Preco</th>
                    </tr>
                </thead>
            </table>
        </div>
    )
}
